import React, { useState } from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSearch, faPlus } from '@fortawesome/free-solid-svg-icons';
import { useNavigate } from "react-router-dom";

const TravelBucketlist = () => {
  const [searchQuery, setSearchQuery] = useState("");
  const [cityDropdownOpen, setCityDropdownOpen] = useState(false);
  const [selectedCity, setSelectedCity] = useState("");
  const navigate = useNavigate();

  const handleSearch = (event) => {
    event.preventDefault();
    // Perform search based on the searchQuery
    // You can implement your logic here to search the map or perform any other actions
    console.log("Search query:", searchQuery);
    navigate("/interestmatching"); // Redirect to "/interestmatching"
  };

  const handleCitySelect = (city) => {
    setSelectedCity(city);
    setCityDropdownOpen(false);
  };

  return (
    <div className="travel-bucketlist layout-container">
      <div className="map">
        {/* Add your map component or use an iframe to display the map */}
        {/* Example: <iframe src="your_map_url" title="Map" /> */}
      </div>
      <div className="city-dropdown">
        {cityDropdownOpen && (
          <div className="city-dropdown-content">
            <p onClick={() => handleCitySelect("City 1")}>City 1</p>
            <p onClick={() => handleCitySelect("City 2")}>City 2</p>
            <p onClick={() => handleCitySelect("City 3")}>City 3</p>
            <p onClick={() => handleCitySelect("City 4")}>City 4</p>
            <p onClick={() => handleCitySelect("City 5")}>City 5</p>
          </div>
        )}
        {!cityDropdownOpen && (
          <button
            className="plus-button"
            onClick={() => setCityDropdownOpen(true)}
          >
            <FontAwesomeIcon icon={faPlus} />
          </button>
        )}
      </div>
      {selectedCity && <p>Selected City: {selectedCity}</p>}
      {cityDropdownOpen && (
        <form className="search-bar">
          <input
            type="text"
            placeholder="Search in map..."
            value={searchQuery}
            onChange={(e) => setSearchQuery(e.target.value)}
          />
          <button className="search-button" onClick={handleSearch}>
            <FontAwesomeIcon icon={faSearch} />
          </button>
        </form>
      )}
    </div>
  );
};

export default TravelBucketlist;
